angular.module("ngTicker",[]).factory("ngTicker",["$rootScope",function(o){return{ticker:function(o){var n=moment(o,moment.ISO_8601),r=moment(n).diff(moment(),"seconds"),t=Math.floor(r/3600),e=Math.floor((r-3600*t)/60),m=r-3600*t-60*e;return m=Math.round(100*m)/100,{hours:10>t?"0"+t:t,minutes:10>e?"0"+e:e,seconds:10>m?"0"+m:m}}}}]);